●ピラミッドグリルがフルモデルチェンジしました<br>
●灰受け皿　標準装備<br>
●焚き火、バーベキュー、ダッチオーブン料理、3つの楽しみがこれ1台でOK！<br>
●12inchダッチオーブンが使用可能　（※オーブンの形状によっては使用できない場合もあります）<br>
●簡単！10秒組み立て、10秒収納<br>
●収納サイズは極薄コンパクト<br>
●キャリーバッグ付<br>
●2～6人用<br>
<br>
※ご注意<br>
製品には鋭利な部分がございます。必ずご使用に際しては皮手袋か軍手（洗浄時はゴム手袋）を着用し、<br>
鋭利な部分で怪我をしないようご注意ください。<br>
■総重量：（約）3.2kg<br>
■主素材：スチール<br>
■主素材：[本体]ステンレス<br>
[スタンド]スチール（クロムメッキ）<br>
[網]スチール（クロムメッキ）<br>
[灰受け皿]亜鉛メッキ鋼板<br>
<br>
※商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。 


